qq@Exception 提问群里都在做什么，进行了各方面介绍，建议参考历史项目（知乎专栏文章）选感兴趣的入手。

@chuanjiao10 分享了几个比较典型的中文命名更适合的例子，建议加到[wiki](https://github.com/program-in-chinese/overview/wiki/%E6%9B%B4%E6%98%93%E4%BA%8E%E4%BD%BF%E7%94%A8%E4%B8%AD%E6%96%87%E5%91%BD%E5%90%8D%E7%9A%84%E4%BE%8B%E5%AD%90)

@cflw 在钻研游戏开发中的分辨率动态更新，以及Python网络设备库的重构。

@RimoChan 编写了中文标识符机翻为英文的[工具](https://www.zhihu.com/question/323049857/answer/679533177)，以及使用Librian编写的[小说剧本](https://github.com/RimoChan/Einstein-and-The-Other-World-Computer-Network)，也许以后可以和[学科结合](https://zhuanlan.zhihu.com/p/47807062), 编写历史事件剧本等

@htwx CTS核心部分进入内测，还在进行更多库的汉化。个人打算参考[之前的5分钟教程](https://zhuanlan.zhihu.com/p/36559989)写个环境搭建过程，在组内先进行介绍。

@nobodxbodon 详见微信公众号“用中文编程”文章。
